import React, { Component } from "react";
import videoSource from "../media/HomeBackgroundVideo.mp4";
import {
  Card,
  Container,
  Paper,
  Typography,
  AppBar,
  Toolbar,
} from "@material-ui/core";

function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {"Copyright © "}
      {new Date().getFullYear()}
      {"."}
      {"CONQUER V2.0 by Shashwat Kansal and Akshat Tripathi"}
    </Typography>
  );
}

export class Home extends Component {
  render() {
    return (
      <div className="home-page">
        <video loop autoPlay className="home-video">
          <source src={videoSource} type="video/mp4" />
          Your browser unfortunately does not yet support the video tag!
        </video>
        <AppBar position="absolute" color="default">
          <Toolbar>
            <Typography variant="h6" color="inherit" align="center">
              CONQUER V2.0
            </Typography>
          </Toolbar>
        </AppBar>
        <div className="title-container">
          <Paper elevation={5} variant="elevation">
            <Typography component="h1" variant="h4" align="center">
              CONQUER V2.0
            </Typography>
          </Paper>
        </div>
        <div z-index="2">
          <Copyright />
        </div>
      </div>
    );
  }
}
